import React from 'react';
import InputField from './InputField';
import SocialIcons from './SocialIcons';

const RegisterForm = () => {
    const handleSubmit = (e) => {
        e.preventDefault();
        // Logic xử lý đăng ký
        console.log('Register submitted');
    };

    return (
        <div className="form-box register">
        <div>
            <h1>Registration</h1>
            <InputField type="text" placeholder="Username" icon="bx bxs-user" />
            <InputField type="email" placeholder="Email" icon="bx bxs-envelope" />
            <InputField type="password" placeholder="Password" icon="bx bxs-lock-alt" />
            
            <button onClick={handleSubmit} className="btn">Register</button>
            <p>or register with social platforms</p>
            <SocialIcons />
        </div>
        </div>
    );
};

export default RegisterForm;
